        display: grid;
        grid-template-columns: 1fr 1fr;

        .project-box {
          position: relative;
          padding: 30px;
          cursor: pointer;
          transition: all 0.5 ease-in-out;
          -webkit-background-size: cover;
          -moz-background-size: cover;
          -o-background-size: cover;
          background-size: cover;
          height: 400px;

          &:hover {
            -webkit-box-shadow: 0px 20px 74px 6px rgba(0, 0, 0, 0.12);
            -moz-box-shadow: 0px 20px 74px 6px rgba(0, 0, 0, 0.12);
            box-shadow: 0px 20px 74px 6px rgba(0, 0, 0, 0.12);
          }

          .grey-bg {
            overflow: hidden;
            position: absolute;
            background: #efefef;
            top: 0;
            bottom: 0;
            right: 0;
            left: 0;
            opacity: 0;
            transition: all 0.5s ease-in-out;
            &:hover {
              opacity: 0.9;
              .project-info {
                .project-details {
                  opacity: 1;
                  transform: translate3d(0, 0, 0);
                }
                .project-title {
                  opacity: 1;
                  transform: translate3d(0, 0, 0);
                }
              }
            }

            .project-info {
              padding: 56px;
              position: absolute;
              width: 100%;
              bottom: 0;

              .project-details {
                margin: 0 0 1rem;
                position: relative;
                font-size: 1.1rem;
                opacity: 0;
                text-transform: capitalize;
                transform: translate3d(-200px, 0, 0);
                transition: all 0.5s ease-in;
              }
              .project-title {
                font-size: 1.8rem;
                text-transform: uppercase;
                transform: translate3d(-100px, 0, 0);
                opacity: 0;
                font-weight: 700;
                transition: all 0.3s ease-in 0.1s;
              }
              .fa-long-arrow-alt-right {
                position: absolute;
                bottom: 56px;
                right: 56px;
                font-size: 3rem;
              }
            }
          }

          h5 {
            font-weight: 500;
            font-size: 1.3rem;
            margin-bottom: 1.4rem;
          }

          p {
            font-weight: 300;
            font-size: 1rem;
            margin-bottom: 1rem;
          }
        }
      }
    }
  }
}

