        top: 56px;
        left: -250px;
        width: 500px;
        height: calc(100% - 112px);
        background: $color2;
        color: $color3;
        padding: 46px;
        -webkit-box-shadow: 9px 18px 74px 6px rgba(10, 10, 10, 1);
        -moz-box-shadow: 9px 18px 74px 6px rgba(10, 10, 10, 1);
        box-shadow: 9px 18px 74px 6px rgba(10, 10, 10, 1);

        h4 {
          margin-top: 2rem;
          font-size: 1.3rem;
          margin-bottom: 4rem;
        }

        input[type="text"],
        input[type="email"],
        textarea {
          width: 100%;
          background: transparent;
          border: none;
          border-bottom: 2px solid $color5;
          margin-bottom: 2rem;
          font-size: 0.8rem;
          text-transform: uppercase;
          line-height: 1.2;
          color: $color5;
          padding: 15px 0;
        }
        button[type="submit"] {
          -webkit-border-radius: 30px;
          -moz-border-radius: 30px;
          border-radius: 30px;
          text-align: center;
          color: $color3;
          background: $color1;
          border: none;
          font-size: 1rem;
          padding: 17px 30px;
          color: white;
          text-transform: uppercase;
          width: 100%;
        }
      }
    }

    .contact-section {
      vertical-align: top;
      display: inline-block;
      width: 70%;
      float: right;
      padding: 56px;

      .contact-info {
        h1 {
          font-size: 2.3rem;
          font-weight: 500;
          line-height: 1.3;
          margin: 0 0 1rem;
          span {
            color: $color1;
          }
        }
        .contact-box {
          max-width: 600px;
          width: 100%;
          padding: 30px;
          cursor: pointer;
          transition: all 0.5 ease-in-out;
          &:hover {
            -webkit-box-shadow: 0px 20px 74px 6px rgba(0, 0, 0, 0.12);
            -moz-box-shadow: 0px 20px 74px 6px rgba(0, 0, 0, 0.12);
            box-shadow: 0px 20px 74px 6px rgba(0, 0, 0, 0.12);
          }

          h5 {
            font-weight: 600;
            font-size: 1.1rem;
            margin: 0 0 1.5rem;
          }
          p {
            color: $color5;
            font-weight: 300;
            line-height: 1.4;
            margin: 0 0 2rem;
          }
        }
      }
    }
  }
}
